import React from "react";
import "../../components/homeContent/about.css";

function About() {
  return (
    <div className="aboutDiv">
      <div className="backgroundColorDiv"></div>
      <div className="image">
      <img
        src="https://img.freepik.com/free-photo/pensive-smiling-brunette-woman-shirt-sitting-floor-with-laptop-computer-looking-up-gray_171337-1207.jpg?w=900&t=st=1695359797~exp=1695360397~hmac=7d10f76193e99f6b68eedfc8756beaaa81304f1e25f7e827df1067253a947e51"
        alt="instructorImg"
        className="instructorImg"
      ></img></div>
      <div className="contentDiv">
        <h2 className="heading">About us</h2>
        <p className="about">
        Valmiki is a comprehensive, free platform offering a wide range of college courses, along with an integrated coding platform for hands-on practice. Explore limitless learning opportunities without any cost.{" "}
        </p>
      </div>
    </div>
  );
}

export default About;
